#content {
    background-color: #12141a;
    border: 1px solid #808080;
}
div, dl, dt, dd, ul, ol, li, h1, h2, h3, h4, h5, h6, pre, form, p, blockquote, th, td {
    margin: 0;
    padding: 0;
    background-color: #11141a;
}
.panel {
    border-style: solid;
    border-width: 1px;
    border-color: #11141a;
    margin-bottom: 1.25rem;
    padding: 10px;
    background: #ab2727;
}
body {
    background: #f7f7f7;
    color: #444444;
    padding: 0;
    margin: 0;
    font-family: "Open Sans", "Helvetica Neue", "Helvetica", Helvetica, Arial, sans-serif;
    font-weight: normal;
    font-style: normal;
    line-height: 0;
    position: relative;
    cursor: default;
}
#main-menu li a {
    color: #ffffff;
}
#searchsubmit {
    float: right;
    margin: 0;
    width: 25%;
    padding: 0px 5px !important;
    background: #ab2727;
}
.movie.big {
    width: 182px;
    background-color: #11141a;
}
.movie {
    background: #000000 none repeat scroll 0 0;
    border: 1px solid #11141a;
    display: block;
    float: left;
    margin: 0 0 10px 5px;
    padding: 0px;
    position: relative;
    transition: all 0.2s ease-in-out 0s;  
}
.post-info {
    padding: 5px 10px;
    background: #11141a;
    border-bottom: 1px solid #11141a;
    box-shadow: 0px -1px 0px 0px #11141a inset;
}
span.author, time {
    color: #fff;
}
div, dl, dt, dd, ul, ol, li, h1, h2, h3, h4, h5, h6, pre, form, p, blockquote, th, td {
    margin: 0;
    padding: 0;
    color: white;
}
.movie.big .thumb_title {
    width: 100%;
    color: white;
    background-color: black;
}
    .thumb_title {

    width: 100.0%;
    opacity: 0.9;
    bottom: 0;
}
.post {
    border: 4px solid #ab2727;
    width: 100.0%;
    padding: 5px 5px;
}
.responsive-tabs .responsive-tabs__panel {
    background: #11141a;
    border: 4px solid #ab7d27;
    border-top: 4px solid #ab7d27;
}
.entry-content img {
    border: 1px solid #ab2727;
    background-color: #ab2727;
}
#header {
    background-color: #111219;
    box-shadow: 0.5px 27px #0f1116 inset;
}
#main-menu {
    background-color: #11141a;
    box-shadow: 0.5px 27px #11141a inset;
}
input[type="text"], input[type="password"], input[type="date"], input[type="datetime"], input[type="datetime-local"], input[type="month"], input[type="week"], input[type="email"], input[type="number"], input[type="search"], input[type="tel"], input[type="time"], input[type="url"], textarea {
    -webkit-appearance: none;
    background-color: white;
    font-family: inherit;
    border: 4px solid #ab2727;
    box-shadow: inset 0 1px 2px rgba(0, 0, 0, 0.1);
    color: rgba(0, 0, 0, 0.75);
    display: block;
    font-size: 0.875rem;
    margin: 0 0 1rem 0;
    padding: 0.5rem;
    height: 2.3125rem;
    width: 100%;
    -webkit-box-sizing: border-box;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    transition: box-shadow 0.45s, border-color 0.45s ease-in-out;
}
#main-search #s {
    float: left;
    width: 75.3%;
    background-color: #fff;
    color: white;
}
#searchform::after {
    content: " ";
    display: block;
}
.tst {
   margin: 0 0 0px 0;
}
#main-search {
    margin: 0 0 0px;
}
.page-numbers li span.current {
    background: #ab2727;
    padding: 0.0625rem 0.625rem 0.0625rem;
    color: white;
    font-weight: bold;
    cursor: default;
    font-size: 1.075rem;
}
.page-numbers li a {
    display: block;
    padding: 0.0825rem 0.625rem 0.0825rem;
    color: #ffffff;
    border-radius: 0px;
    margin: 1111 0 0px 0;
    border: 1px solid #aa2727;
    font-size: 1.075rem;
}
